// src/Outcome.js
import React from 'react';

function Outcome({ programs }) {
  return (
    <div className="outcome-container">
      <div className="outcome-card">
        {programs && programs.length > 0 ? (
          <>
            <h2 className="outcome-heading">
              Based on your answers, you may be eligible for the following programs:
            </h2>
            <ul className="programs-list">
              {programs.map((program) => (
                <li key={program} className="program-item">
                  {program}
                </li>
              ))}
            </ul>
            <p className="outcome-text">
              Please contact the appropriate agencies to confirm your eligibility and begin the application
              process.
            </p>
          </>
        ) : (
          <h2 className="outcome-heading">
            Based on your answers, you may need to contact MassHealth for more information about your
            eligibility.
          </h2>
        )}
      </div>
    </div>
  );
}

export default Outcome;
